import ReactDOM from 'react-dom/client';
import Card from './Card';
import '../src/index.css';
const root=ReactDOM.createRoot(document.getElementById('root'));
root.render(<>
    <>
    <React.StrictMode>
      <div className="allCards">
      <Card src="https://picsum.photos/seed/picsum/200/300" sname="Dark" title="A Netflix Original Series" link="https://www.netflix.com/"/>
      <Card src="https://picsum.photos/seed/picsum/200/300" sname="kataramaidu" title="A Netflix Original Series" link="https://www.netflix.com/"/>
      <Card src="https://picsum.photos/seed/picsum/200/300" sname="Bahubali" title="A Netflix Original Series" link="https://www.netflix.com/"/>
      </div>
      </React.StrictMode>
    </>
</>);
